import LevelBuilderfrom sprites import *def render(name,bg):	lb = LevelBuilder.LevelBuilder(name+".plist",background=bg)	lb.addObject(Enemy.EnemySprite(x=247, y=126,width=183,height=183,angle='0',restitution=0.2,static='false',friction=0.5,density=2 ).setName('Enemy'))	lb.addObject(Friend.FriendSprite(x=248, y=18,width=32,height=32,angle='0',restitution=0.2,static='false',friction=0.5,density=20 ))	lb.addObject(Joints.RevoluteJoint(body1='Enemy',body2='Friend',motor_speed='500',enable_motor='true',torque='10000',lower_angle='12',upper_angle='50',enable_limit='false',collide_connected='false'))	lb.addObject(Hero.HeroSprite(x=22, y=18,width=32,height=32))	lb.addObject(Star.StarSprite(x=439, y=131,width=32,height=32))	lb.addObject(Joints.DistanceJoint(body1='Enemy',body2='Star',damping='0.2',freq='5' ))	lb.render()